// import * as global from "./serviceHelpers";
import axios from "axios";

let submitProfile = payload => {
  const configs = {
    method: "POST",
    url: "/api/myproject",
    data: payload,
    withCredentials: true,
    crossdomain: true,
    headers: { "Content-Type": "application/json" }
  };
  return axios(configs);
};

let getAllProfiles = () => {
  const configs = {
    method: "GET",
    url: "/api/myproject",
    // + "/teachers",
    // data: payload,
    withCredentials: true,
    crossdomain: true,
    headers: { "Content-Type": "application/json" }
  };
  return axios(configs);
};

let getProfileById = id => {
  const configs = {
    method: "GET",
    url: "/api/myproject/" + id,
    // data: id,
    withCredentials: true,
    crossdomain: true,
    headers: { "Content-Type": "application/json" }
  };
  return axios(configs);
};

export { submitProfile, getAllProfiles, getProfileById };
